import { makeStyles } from "@material-ui/core";

const homePageStyles = makeStyles({
  root: {
    width: "90vw",
    height: "86vh",
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%,-50%)",
    overflow: "auto",
    borderRadius: 0,
  },
  tableBody: {
    "&:nth-child(even) tr:nth-child(odd)": {
      backgroundColor: "#2C394B",
    },
    "&:nth-child(even) tr:nth-child(even)": {
      backgroundColor: "#334756",
    },
  },
  tableCell: {
    border: "none",
    padding: "10px",
    color: "whitesmoke",
  },
  tableCellHeader: {
    border: "none",
    padding: "16px 10px",
    fontSize: "1rem",
    fontWeight: 600,
    color: "whitesmoke",
    backgroundColor: "#334756",
  },
  link: {
    color: "whitesmoke",
  },
});

export default homePageStyles;
